import{loadScript}from"/scripts/src/loadScript.min.js";async function downloadTexWithGraphics(filename,text,imageUrls){await Promise.all([loadScript("/scripts/jszip.min.js"),loadScript("/scripts/fileSaver.min.js")]);var e=new JSZip,t=(e.file(filename+".tex",text),e.folder("graphics"));for(const a of imageUrls){var i=await fetch(a).then(res=>res.blob());t.file(a.split("/").pop(),i)}e=await e.generateAsync({type:"blob"});saveAs(e,filename+".zip")}function downloadTex(filename,text){var e=document.createElement("a");e.setAttribute("href","data:text/x-tex;charset=utf-8,"+encodeURIComponent(text)),e.setAttribute("download",filename+".tex"),e.style.display="none",document.body.appendChild(e),e.click(),document.body.removeChild(e)}